import React from 'react';
import EmptyTeam from './EmptyTeam';
import TeamGrid from './TeamGrid';
import './Home.css';

const Home = () => {
  const superherosList = [1];

  let content = superherosList.length > 0 ? <TeamGrid /> : <EmptyTeam />;

  return (
    <section
      style={{ height: '100vh' }}
      className='d-flex mt-5 justify-content-center'
    >
      <div
        class='d-flex flex-column align-items-center alert alert-primary w-50 h-50 p-3'
        role='alert'
      ></div>

      {superherosList.length > 0 && (
        <div className='container bg-primary h-75 mt-5 rounded'>CARDS</div>
      )}
    </section>
  );
};

export default Home;
